import React, { Component } from "react";
import Footer from "../layout/Footer";
import Header from "../layout/Header";
import Sidebar from "../layout/Sidebar";
import { Link } from "react-router-dom";
import './Dashboard.css';
const axios = require("axios").default;



class Dashboard extends Component {
    componentDidMount() {
        axios.get(process.env.REACT_APP_BASE_URL + "/api/admin/fetch-master-data")
          .then((response) => {
            var centre = response.data.centres
            var project = response.data.projects
            var team = response.data.teams
            var agency = response.data.agencys


            this.setState({
              centre: centre,
              project: project,
              project_head: team,
              funding_agency: agency,
            })

          }).catch((error) => {
            console.log(error.response);
          })

      }
    render() {
        return (
            <>
                <Header />
                <Sidebar />

                <div className="content-wrapper">
                    {/* Content Header (Page header) */}

                    {/* /.content-header */}
                    {/* Main content */}
                    <section className="content dashboardImg">
                        <div className="container-fluid ">
                            {/* Small boxes (Stat box) */}
                            <div className="row p-5">
                                <div className="col-md-4 col-6 p-3 mt-3">
                                    {/* small box */}
                                    <div className="small-box card">
                                        <div className="icon">
                                            <i className="fa fa-globe" style={{
                                                color: '#6bd098!important', fontSize: "40px",
                                                top: "20px", right: "20px"
                                            }} />
                                        </div>
                                        <div className="inner">
                                            {/* <p>Director</p> */}
                                            <h4> C-Cube </h4>
                                        </div>
                                        {/* <a href="#/" className="small-box-footer"><i className="bi bi-arrow-clockwise" /> Details More... </a> */}
                                    </div>
                                </div>

                                <div className="col-md-4 col-6 p-3 mt-3">
                                    {/* small box */}
                                    <div className="small-box card customcolor">
                                        <div className="icon">
                                            <i className="fa fa-window-maximize" aria-hidden="true" style={{
                                                color: '#6bd098!important', fontSize: "40px",
                                                top: "20px", right: "20px"
                                            }} />
                                        </div>
                                        <div className="inner">
                                            <Link to="/overall-dashboard">
                                            <h4 className="text-dark"> CDG </h4>
                                            </Link>
                                        </div>
                                    </div>
                                </div>
                                <div className="col-md-4 col-6 p-3 mt-3">
                                    {/* small box */}
                                    <div className="small-box card">
                                        <div className="icon">
                                            <i className="fa fa-area-chart" style={{
                                                color: '#6bd098!important', fontSize: "40px",
                                                top: "20px", right: "20px"
                                            }} />
                                        </div>
                                        <div className="inner">
                                            {/* <p>Director</p> */}
                                            <h4>CUEG</h4>
                                        </div>
                                        {/* <a href="#/" className="small-box-footer"><i className="bi bi-stopwatch" />Details More...</a> */}
                                    </div>
                                </div>

                                <div className="col-md-4 col-6 p-3 ">
                                    {/* small box */}
                                    <div className="small-box card">
                                        <div className="icon">
                                            <i className="fa fa-adjust " style={{
                                                color: '#6bd098!important', fontSize: "40px",
                                                top: "20px", right: "20px"
                                            }} />
                                        </div>
                                        <div className="inner">
                                            {/* <p>Director</p> */}
                                            <h4>CMFG</h4>
                                        </div>
                                        {/* <a href="#/" className="small-box-footer"><i className="bi bi-stopwatch" />Details More...</a> */}
                                    </div>
                                </div>
                                <div className="col-md-4 col-6 p-3">
                                    {/* small box */}
                                    <div className="small-box card">
                                        <div className="icon">
                                            <i className="fa fa-clone " style={{
                                                color: '#6bd098!important', fontSize: "40px",
                                                top: "20px", right: "20px"
                                            }} />
                                        </div>
                                        <div className="inner">
                                            {/* <p>Director</p> */}
                                            <h4>ICC</h4>
                                        </div>
                                        {/* <a href="#/" className="small-box-footer"><i className="bi bi-stopwatch" />Details More...</a> */}
                                    </div>
                                </div>
                                <div className="col-md-4 col-6 p-3">
                                    {/* small box */}
                                    <div className="small-box card">
                                        <div className="icon">
                                            <i className="fa fa-tree" style={{
                                                color: '#6bd098!important', fontSize: "40px",
                                                top: "20px", right: "20px"
                                            }} />
                                        </div>
                                        <div className="inner">
                                            {/* <p>Director</p> */}
                                            <h4>CSSD</h4>
                                        </div>
                                        {/* <a href="#/" className="small-box-footer"><i className="bi bi-stopwatch" />Details More...</a> */}
                                    </div>
                                </div>
                                <div className="col-md-4 col-6 p-3">
                                    {/* small box */}
                                    <div className="small-box card">
                                        <div className="icon">
                                            <i className="fa fa-tree" style={{
                                                color: '#6bd098!important', fontSize: "40px",
                                                top: "20px", right: "20px"
                                            }} />
                                        </div>
                                        <div className="inner">
                                            {/* <p>Director</p> */}
                                            <h4>All</h4>
                                        </div>
                                        {/* <a href="#/" className="small-box-footer"><i className="bi bi-stopwatch" />Details More...</a> */}
                                    </div>
                                </div>



                            </div>


                            {/* /.row */}

                        </div>
                        {/* /.container-fluid */}
                    </section>
                    {/* /.content */}
                </div>


                <Footer />
            </>
        );
    }
}

export default Dashboard;
